(307, 'FF032C2E-45B3-47D9-9C1E-33F49CEF2259', 'We had breakfast, cleaned up the place and we did have sex. Was that not okay? I don‚Äôt remember making a commitment that we would not have any physical contact. Your request was that we not do that in the house. ', 'David', 'Nitzan', '2024-08-30T11:32:06.792000'),
