(298, 'D6BFB361-32F9-4945-9E0A-37DEA38D5952', 'IÔ∏è think just the vibe of ‚Äúit‚Äôs so relaxed and chill and cool and whatever‚Ä¶‚Äù and then IÔ∏è watched you bolt out of the house as fast as humanely possible just sends the opposite vibe and makes it feel a lot more intense. ', 'Nitzan', 'David', '2024-08-30T11:51:17.000258'),
(330, '2A8D74EC-C3A1-4108-B19F-56DBE455974A', 'IÔ∏è just think you really blew it this morning with managing my expectations and playing down everything. That reminds me of older days and makes me feel really bad.', 'Nitzan', 'David', '2024-08-30T11:51:51.762235'),
