(286, '17E3E941-FD08-46DE-9DFD-B4C1DE8D84CF', 'So much richness. So much wonderful exploration. And being with you makes it all possible.  Misha commented to me how you are fire (her reflection from the few minutes you met). And it is true. Your fire just renews day after day‚Ä¶.as I said while we are on shrooms‚Ä¶.you are just so hot, you need to have ice all the time in your body (while I need to drink tea!) The warmth and the heat and the hotness. I love you in all your fiery-ness. ', 'David', 'Nitzan', '2024-09-02T22:24:02.759801'),
