(159, 'C2DEBDDD-76F3-4AB4-BB89-D16DACD48A95', 'It was an excellent weekend with the river folks and for building our community at Chochmat. IÔ∏è also had such a lovely afternoon of debate and fire with Nir, Jay, Halleli and Pamela while the kids frolicked and enjoyed the pool. Feels good to be a part of many communities and to be building connection in quite a number of places. ', 'Nitzan', 'David', '2024-09-02T22:58:10.664528'),
